END;

%script
ALTER TABLE kdd_train  ADD id number;
UPDATE kdd_train SET id = ROWNUM; 
ALTER TABLE kdd_test  ADD id number;
UPDATE kdd_test SET id = ROWNUM; 
ALTER TABLE  kdd_train DROP COLUMN NIL;
ALTER TABLE  kdd_test DROP COLUMN NIL;

%sql
CREATE TABLE KDD_ATTACKTYPE (
    attack VARCHAR(4000),
    category VARCHAR(4000)
);

%script
BEGIN
DBMS_CLOUD.COPY_DATA(
    table_name =>'KDD_ATTACKTYPE',
    credential_name =>'CRED_KDD',
    --https://objectstorage.us-ashburn-1.oraclecloud.com/n/italysandbox/b/adwhimport/o/Attack_Type.txt
    file_uri_list =>'https://swiftobjectstorage.us-ashburn-1.oraclecloud.com/v1/italysandbox/adwhimport/training_attack_types.txt',
    format => json_object('delimiter' value ' ')
 );
insert into KDD_ATTACKTYPE (attack,category) values ('normal','normal');
END;

%script
CALL DBMS_DATA_MINING.DROP_MODEL('KDD_CLASS_MODEL');
DROP TABLE  KDD_BUILD_SETTINGS;

%script
BEGIN
  EXECUTE IMMEDIATE 'CREATE TABLE KDD_BUILD_SETTINGS (SETTING_NAME VARCHAR2(30), SETTING_VALUE VARCHAR2(4000))';
  EXECUTE IMMEDIATE 'INSERT INTO KDD_BUILD_SETTINGS (SETTING_NAME, SETTING_VALUE) VALUES (''ALGO_NAME'',''ALGO_DECISION_TREE'')';
  EXECUTE IMMEDIATE 'CALL DBMS_DATA_MINING.CREATE_MODEL(''KDD_CLASS_MODEL'',''CLASSIFICATION'',''KDD_TRAIN'',''ID'',''TYPE'',''KDD_BUILD_SETTINGS'')';
END;

%script
DROP VIEW KDD_TEST_RESULT_view;
DROP TABLE KDD_TEST_RESULT;
DROP TABLE KDD_TEST_confusion_matrix;
DROP TABLE KDD_TEST_cost_matrix;

%script


begin
 declare 
 v_accuracy NUMBER;
 begin
  DBMS_DATA_MINING.APPLY(
  model_name           => 'KDD_CLASS_MODEL',
  data_table_name      => 'KDD_TEST',
  case_id_column_name  => 'id',
  result_table_name    => 'KDD_TEST_RESULT');

  EXECUTE IMMEDIATE('CREATE VIEW KDD_TEST_RESULT_view as select id, type from KDD_TEST');


  DBMS_DATA_MINING.COMPUTE_CONFUSION_MATRIX(
      accuracy  => v_accuracy,
      apply_result_table_name   => 'KDD_TEST_RESULT',
      target_table_name            => 'KDD_TEST_RESULT_view',
      case_id_column_name          => 'id',
      target_column_name           => 'type',
      confusion_matrix_table_name  => 'KDD_TEST_confusion_matrix'
      );
  DBMS_OUTPUT.PUT_LINE('Accuracy of the model: ' || v_accuracy);
 end;
end;

%script

declare
type loc_array_type is table of varchar2(4000) index by binary_integer;
loc_array loc_array_type;
dml_str varchar2(400);
insert_str varchar2(400);
update_str  varchar2(4000);

BEGIN
execute immediate('drop table  kdd_confusion_matrix');
execute immediate ('create table kdd_confusion_matrix (actual varchar2(4000))');

select distinct(category) bulk collect into loc_array from   kdd_attacktype;
FOR i IN loc_array.first..loc_array.last LOOP
    dml_str := 'ALTER TABLE  kdd_confusion_matrix  ADD ' || loc_array(i) || ' number';
    execute immediate dml_str;
END LOOP;

FOR i IN loc_array.first..loc_array.last LOOP
    insert_str := 'INSERT INTO kdd_confusion_matrix  ( actual ) VALUES ('''|| loc_array(i)||''')';
    execute immediate insert_str;
END LOOP;

FOR i IN loc_array.first..loc_array.last LOOP
    FOR j IN loc_array.first..loc_array.last LOOP

    update_str:='update  kdd_confusion_matrix set '|| loc_array(i) || ' = (select value from KDD_TEST_confusion_matrix where  actual_target_value='''|| loc_array(j) ||''' and predicted_target_value = '''||loc_array(i)||''' ) where kdd_confusion_matrix.actual='''|| loc_array(j) || '''';
    execute immediate update_str; 
    END LOOP;

END LOOP;

END;
